import {
    Button,
    Form,
} from 'react-bootstrap';

const Search = () => {
    return (
        <Form class="d-flex">
            <Form.Group controlId="formSearch">
                <Form.Control type="text" placeholder="Cari berita" size="sm" />
                <Button variant="primary" type="submit" size="sm">Cari</Button>
            </Form.Group>
        </Form>
    )
}

export default Search
